window.JST = window.JST || {};
var template = function(str){var fn = new Function('obj', 'var __p=[],print=function(){__p.push.apply(__p,arguments);};with(obj||{}){__p.push(\''+str.replace(/\\/g, '\\\\').replace(/'/g, "\\'").replace(/<%=([\s\S]+?)%>/g,function(match,code){return "',"+code.replace(/\\'/g, "'")+",'";}).replace(/<%([\s\S]+?)%>/g,function(match,code){return "');"+code.replace(/\\'/g, "'").replace(/[\r\n\t]/g,' ')+"__p.push('";}).replace(/\r/g,'\\r').replace(/\n/g,'\\n').replace(/\t/g,'\\t')+"');}return __p.join('');");return fn;};
window.JST['query'] = template('<p ng-if="search_error">\n  <span class="label label-danger">Search Error</span>\n  {{ search_error }}\n</p>\n\n<p ng-if="completed && success && !last_model">\n  <em>No matching data</em>\n</p>\n\n<div ng-if="completed && success && last_model">\n\n<div id="results-header">\n  <span class="page-summary">\n    {{ table.view.current_page*table.view.page_size+1 }}-{{ table.view.current_page*table.view.page_size+table.view.getCurrentItems().length }}/{{ table.length }}\n    row(s) of <b>{{ last_model }}</b>\n  </span>\n  <span class="paging paging-prev">\n    <a href="javascript:void(0);"\n       ng-click="table.prevPage()"\n       ng-if="table.view.current_page > 0">Prev</a>\n  </span>\n  <span class="paging paging-next">\n    <a href="javascript:void(0);"\n       ng-click="table.nextPage()"\n       ng-if="table.view.current_page*table.view.page_size+table.view.page_size < table.length">Next</a>\n  </span>\n  <div id="recommended_rels" class="dropdown navbar-right">\n    <a data-toggle="dropdown" href="javascript:void(0);">Relations from {{ last_model }}</a>\n    <ul class="rel-list dropdown-menu" role="menu">\n      <li ng-repeat="rel in last_model_rels">\n        <span class="rel-actions">\n          <a class="btn btn-xs btn-info" href=\'javascript:void(0);\' title="Extend query"\n             ng-click="extendQuery(last_model, rel)">Q</a>\n        </span>\n        <span class="rel-name">{{ rel }}</span>\n      </li>\n    </ul>\n  </div> <!-- recommended_rels -->\n</div>\n\n<table class="table table-condensed table-striped table-bordered table-fixed" ng-if="table.attrs">\n  <tr class="success">\n    <td class="id"></td>\n    <td class="wrap" ng-repeat="q in table.queries track by $index" colspan="{{ q.cols }}">\n      <a href="javascript:void(0)" ng-click="table.toggleQuery($index)" title="Click to show/hide attrs"\n       >{{ q.model }}</a>\n    </td>\n  </tr>\n\n  <tr class="success">\n    <th class="id"></th>\n    <th class="wrap" ng-repeat="attr in table.attrs track by $index" ng-if="attr.visible">{{ attr.name }}</th>\n  </tr>\n\n  <tr ng-repeat="row in table.view.getCurrentItems() track by $index">\n    <td class="id">{{ row.i }}</td>\n    <td class="wrap" ng-repeat="object in row.row track by $index" ng-if="table.attrs[$index].visible">\n      <span ng-bind-html="object.ptr[table.attrs[$index].name]|showAttr"></span>\n    </td>\n  </tr>\n</table>\n\n<p ng-if="!table.csv">\n  <a href="javascript:void(0)" ng-click="table.showCSV()">Show CSV</a>\n</p>\n<textarea class="csv" ng-if="table.csv" readonly>{{ table.csv }}</textarea>\n\n</div> <!-- if for results table -->\n');
window.JST['search'] = template('<div class="container-fluid">\n\n<p>\n  <a href="#/" class="lead">Curious</a>\n</p>\n\n<div class="well">\n  <form ng-submit="submitQuery()">\n    <div class="input-group">\n      <span class="input-group-addon">Query</span>\n      <input class="form-control" ng-model="query" ng-change="delayCheckQuery()" />\n    </div>\n  </form>\n</div>\n\n<p ng-if="query_error">\n  <span class="label label-danger">Query Syntax Error</span>\n  <code>{{ query_error }}</code\n</p>\n\n<p ng-if="query_accepted">\n  <span class="label label-info">Valid Query</span>\n  <code>{{ query_accepted }}</code>\n</p>\n\n<div id="results">\n  <div ng-repeat="query in query_submitted">\n    <partial template="query" ng-controller="QueryController"></partial>\n  </div>\n</div>\n\n<div id="queries">\n  <p><h4>Recent Queries</h4></p>\n  <div ng-repeat="query in recent_queries">\n    <a href="#/q/{{ query|encodeURI }}">{{ query }}</a>\n  </div>\n</div>\n\n</div> <!-- container-fluid -->\n');
